import React from "react";
import Deck from '../components/common/Deck';
import Players from '../components/common/Players';
import { IGameProps } from '../shared/types';

export class PlayContainer extends React.Component<IGameProps> {
    render(): JSX.Element {
        return (
            <div>
                { <Deck /> }
                { <Players numberOfPlayers={this.props.numberOfPlayers} />
                }
            </div>
        )
    }
}
